class Solution:
    def canFinish(self, numCourses: int, prerequisites: list[list[int]]) -> bool:
        # self.prerequisites = prerequisites
        self.matrix = self.buildTree(numCourses, prerequisites)

        self.coursesPossible = set()

        isPossible = True

        indexes = list(range(len(self.matrix)))
        random.shuffle(indexes)

        
        # for currCourseIndex in range(0, len(self.matrix)):
        # for currCourseIndex in range(len(self.matrix) - 1, 0, -1):
        for currCourseIndex in indexes:
            print(f"Now checking {currCourseIndex}")
            isPossible = self.iterative_dfs(currCourseIndex)
            if not isPossible:
                return False
            self.coursesPossible.add(currCourseIndex)
        return True

    def buildTree(self, numCourses: int, prerequisites: list[list[int]]) -> list[list[int]]:
        matrix = []

        row = []
        for i in range(numCourses):
            row.append(0)
            
        for i in range(numCourses):
            matrix.append(row.copy())
        
        # display_graph(matrix)

        for prereqSet in prerequisites:
            course = prereqSet[0]
            prereq = prereqSet[1]
            matrix[course][prereq] = 1
        
        # display_graph(matrix)
        return matrix

    def iterative_dfs(self, startCourseIndex: int) -> bool:
        stack = [(startCourseIndex, 0, {startCourseIndex})]

        while stack:
            currCourseIndex, child_index, currentPath = stack.pop()
            
            for prereqIndex in range(child_index, len(self.matrix[currCourseIndex])):
                if self.matrix[currCourseIndex][prereqIndex] == 0:
                    continue
                if currCourseIndex == prereqIndex:
                    return False # this course requires itself as a prereq
                
                

                # That means that if one of the prerequsites is 
                # required in the above tree, this will fail 
                # because it is a circular dependencie
                if prereqIndex in currentPath: 
                    return False
                
                # If the course has already been checked and verified, then skip checking it again
                if prereqIndex in self.coursesPossible:
                    continue

                stack.append((currCourseIndex, prereqIndex + 1, currentPath))

                newPath = currentPath.copy()
                newPath.add(prereqIndex)
                stack.append((prereqIndex, 0, newPath))
                break
            self.coursesPossible.add(currCourseIndex)
        return True


    
    def recurse(self, coursesLeft: int, requiredAbove: list[int], currCourseIndex) -> bool:
        for prereqIndex in range(len(self.matrix[currCourseIndex])):
            prereq = self.matrix[currCourseIndex][prereqIndex]
            if prereq == 0:
                continue
            if currCourseIndex == prereqIndex:
                return False # this course requires itself as a prereq
            
            # That means that if one of the prerequsites is 
            # required in the above tree, this will fail 
            # because it is a circular dependencie
            if prereqIndex in requiredAbove: 
                return False
            
            newRequired = requiredAbove.copy()
            newRequired.append(prereqIndex)

            isPosssible = self.recurse(coursesLeft - 1, newRequired, prereqIndex)

            if not isPosssible:
                return False # A lower branch failed 
        return True

def display_graph(edges: list[list[float]]):
    """
    Prints a nicely formatted representation of the TSP graph (adjacency matrix)
    to the terminal.

    Args:
        edges: A list of lists representing the cost matrix of the graph.
            Inner lists represent the costs from one node to all others.
            math.inf indicates no direct connection.
    """
    num_nodes = len(edges)
    if num_nodes == 0:
        print("Graph is empty.")
        return

    # Determine the maximum width needed for cell values (including "inf")
    max_width = 3  # For "inf"
    for row in edges:
        for cost in row:
            if cost != math.inf:
                max_width = max(max_width, len(f"{cost:.1f}")) # Adjust precision as needed

    # Print header row (node indices)
    header = " " * (max_width + 1)  # Space for the row index
    for i in range(num_nodes):
        header += f"{i:<{max_width + 1}}"
    print(header)
    print("-" * (len(header)))

    # Print each row of the adjacency matrix
    for i in range(num_nodes):
        row_str = f"{i:<{max_width}}|"
        for j in range(num_nodes):
            cost = edges[i][j]
            if cost == math.inf:
                row_str += f"{'inf':<{max_width + 1}}"
            else:
                row_str += f"{cost:<{max_width + 1}.1f}" # Adjust precision as needed
        print(row_str)

